import React from "react";

export default function ProjectPage({ selectedproject, ProjectsDatabase }) {
  return (
    <>
      <main>
        <div class="custom-shape-divider-bottom-1712124019">
                    <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1200 120" preserveAspectRatio="none">
                        <path d="M985.66,92.83C906.67,72,823.78,31,743.84,14.19c-82.26-17.34-168.06-16.33-250.45.39-57.84,11.73-114,31.07-172,41.86A600.21,600.21,0,0,1,0,27.35V120H1200V95.8C1132.19,118.92,1055.71,111.31,985.66,92.83Z" class="shape-fill"></path>
                    </svg>
                </div>
        <section className=" min-h-[40vh] IndexHeaderBackground flex">
          <div className="m-auto text-center">
            <h3 className="text-gray-300 md:text-5xl text-3xl font-bold md:leading-[5.8rem] font-mono francois-one-regular">
              Full Stack Web{" "}
            </h3>
          </div>
        </section>
      </main>
    </>
  );
}
